             }))}>Redux Submit</button> */}
                </div>

                <button onClick={() => dispatch(adduser({}))} > Form Submit r </button>
             <Userlist/>
              {/* </form> */}
          </div>
          </div>


        </div>



    </div>

    </>
  )
}

